import React from 'react';
import Navbare from './Navbare';
const Contact = () => {
    console.log(props.nom);
    return (
        <div>
            <div style={{ marginTop: '100px' }}></div>
            <Navbare/>
            <h3>Contact</h3>
            <p  >eto:{props.nom}</p>
        </div>
    );
};

export default Contact;
